/**
 * @deprecated
 */
export enum FlexAlign {
  START = "start",
  CENTER = "center",
  END = "end",
  STRETCH = "stretch",
  BASELINE = "baseline",
  INITIAL = "initial"
}

/**
 * @deprecated
 */
export enum FlexJustify {
  START = "start",
  CENTER = "center",
  END = "end",
  STRETCH = "stretch",
  SPACE_AROUND = "space-around",
  SPACE_BETWEEN = "space-between",
  INITIAL = "initial"
}

/**
 * @deprecated
 */
export enum FlexGap {
  XS = "xs",
  SMALL = "small",
  MEDIUM = "medium",
  LARGE = "large"
}

/**
 * @deprecated
 */
export enum FlexDirection {
  ROW = "row",
  COLUMN = "column"
}
